import React from 'react';


// La lista va a ser el contenedor
const ListaTareas = ({ tareas }) => {
    return (
        <ul className='lista-tareas'>
            
            {tareas.map((tarea) =>{

                return <li key={tarea.id}>{tarea.texto}</li>
           })}
        </ul>
    );
}

export default ListaTareas;
